import React from "react";
import Navbar from "../../components/Navbar";
import Footer from "../../components/Footer";

const SemesterDisplay = () => {
  return (
    <div className="d-flex flex-column min-vh-100">
      <Navbar />
      <div className="container mt-4 mb-5 flex-grow-1">


        <div className="row">
          <div className="col-md-12">
            <div className="list-group">
              <a href="/semester/1" className="list-group-item list-group-item-action">1st Semester</a>
              <a href="/semester/2" className="list-group-item list-group-item-action">2nd Semester</a>
            </div>
          </div>
        </div>
        <div className="row mt-5">
          <div className="col-12 text-end mb-3">
            <a href="/timetable" className="btn btn-success me-2">View Time Table</a>
          </div>
        </div>

        <div className="row mt-3">
          <div className="col-12 d-flex justify-content-center mb-3">
            <button className="btn btn-primary px-5">Send</button>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default SemesterDisplay;
